import React from 'react';
import ReactDOM from 'react-dom/client';
import "./index.css"
import Card from "./cards"
import Sdata from "./sdata" 

function ncard(val){
  return(
    <Card
      imgscr={val.imgscr}
      title={val.title}
      ilnk={val.title}
      sname={val.sname}
    />
  )


}

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <>

    {Sdata.map(ncard)}
  </>
);
